import React, { useEffect, useState } from "react";
import axios from "axios";

const Acceuil = () => {
  useEffect(() => {
    axios
      .get("https://breakingbadapi.com/api/characters")
      .then(res => console.log(res.data));
  });
  return <div className="acceuil"></div>;
};

export default Acceuil;
